import React, { Component } from 'react';
import SocialLink from '../Common/SocialLink/SocialLink';
import "./Footer.scss";

export default class Footer extends Component {
  render() {
    return (
      <div>
        <h1 className="footer">Footer</h1>
      </div>
    )
  }
}
